/*
`base64EncodedBinary` contains a base64 encoding of the web-tree-sitter compiled to WebAssembly.
	Modifications around it are to import it from a JS/TS file and instantiate it using `WebAssembly.instantiate.`
*/

const base64String = atob(
    ''
)
const base64Buffer = new Uint8Array(base64String.length)
for (var i = 0; i < base64String.length; i++) base64Buffer[i] = base64String.charCodeAt(i)
export default base64Buffer
